import React from 'react';
import './App.css';
import { HashRouter, Switch, Route, Link } from 'react-router-dom';

import Navbar from './Components/Navbar.component';

function App() {
  return (
    <div className="App">
      <HashRouter>
        <Navbar/>
      </HashRouter>
    </div>
  );
}

export default App;
